function render() {
    this.removeDrawing();

    var w = this.getExtent().x,
        h = this.getExtent().y;
    this.vis = this.draw(w, h);

    var svg = this.renderContext().svgNode;
    if (svg) svg.parentNode.removeChild(svg)
    var svg = NodeFactory.create('svg');
    this.renderContext().shapeNode.appendChild(svg);
    this.renderContext().svgNode = svg;
    this.vis.canvas(svg);
    this.vis.render();
}

